        "10_40Window": "Y",
        "LocationInCountry": "The February 1982 National Geographic listed a figure of between 80,000 and 90,000 Gologs, living in six counties of the remote Golog Tibetan Prefecture in Qinghai Province. A total of 100,343 people lived in the prefecture in 1953, but by 1964 the population had diminished to only 56,071. Thousands of Golog migrated from the area. Thousands more were either killed in battle or starved to death by the Chinese army. The Golog region is virtually still outside Chinese control. Its extreme isolation was described by a visitor in the late 1920s: \"A miserable land it is, of poverty and incredible filth; a land cut off from the modern world, a region which, for uncounted centuries, has had its own forms of government, of religion and social customs; yet a region which knows no railway, no motor car, no radio, or aught of all that science and invention have given the world since Marco Polo's day.\"",
