        "LocationInCountry": "The Global Evangelization Movement lists a 1995 population of 2,445 Ladakhi in Tibet. Their inclusion in China was unplanned and outside of their control. Before 1949 all Ladakhi lived in India. The Chinese invaded northern Ladakh in 1949, annexing 38,000 square kilometers (14,820 sq. mi.) of the Aksai Chin region in remote Himalayan territory. Those mountain passes near the China-India border have claimed the lives of many men and beasts. Bleached human and animal bones mark the trail like signposts at regular intervals. Approximately 100,000 Ladakhi live on the Indian side of the border. The Aksai Chin area is so remote that the Indian government did not discover the Chinese had constructed a road there until two years after it was completed.",
