        "RegionCode": 3,
        "RegionName": "Asia, Northeast",
        "10_40Window": "Y",
        "LocationInCountry": "The Ongkor are the smallest group profiled in this book, with just 20 people reported in a 1993 study. Yet those 20 individuals view themselves as a separate ethnic community, speak (or spoke until recently) their own unique language, and hold to a rich history. As recently as the 1945 Xinjiang census, the Ongkor numbered 2,506 people. Since that time they have intermarried with other groups, especially with the Western Daur and Western Xibe. They have rapidly lost their language and identity, so that today a mere 20 individuals could still be considered ethnically distinct. While many would discount the Ongkor as not worthy of mention, it should be remembered that in Vietnam the government has given official minority status to the 32 members of the ODu tribe. The Ongkor inhabit one village near Yining in Xinjiang's Ili Prefecture.",
