        "LocationInCountry": "Approximately 9,000 Oroqen are spread over a vast area of the Outer Xingan Mountain range in northeast Inner Mongolia and in neighboring Heilongjiang Province. The Oroqen population has been affected by rampant disease and violence during the twentieth century. By 1953 their numbers had fallen to just 2,200. Despite their small population, the Oroqen live in a vast area measuring 58,000 square kilometers (22,970 sq. mi.), \"slightly smaller than West Virginia (which has similar terrain) or Belgium and Holland combined.\" When the Hulunbuir Prefecture was established in 1951, 774 of the 778 residents were Oroqen. By 1980 the population of 410,000 contained just 1,315 Oroqens. A small number of Oroqen live across the border in eastern Siberia.",
