        "LocationInCountry": "A small number of people belonging to the Purik people group live in Gar County on the Tibet-India border. The vast majority of Purik inhabit the Suru Valley in the Kargil District of the Indian state of Jammu and Kashmir. The area is surrounded by Ladakh on the east and Baltistan (now controlled by Pakistan) to the north and northwest. The Purik's homeland is one of extremes. They live on the westernmost flange of the Himalayas  - with peaks as high as 7,088 meters (23,250 ft.) and valleys as low as 265 meters (870 ft.) above sea level. Six months of the year Kargil is cut off from the rest of India; winter snows can accumulate up to 1 meters (40 ft.). Temperature between November and February often plummet to minus 45\u00b0 Celsius (-49\u00b0F). The few Purik in Tibet live near the Bunan and Lahuli Tinan.",
