        "LocationInCountry": "In 1980 R. F. Hahn reported the existence of at least 30 Tuerke households, numbering approximately 120 people. Another source lists a 1991 population of 200 Tuerke. There are probably also some Tuerke living in Kazakstan. The Tuerke in China live near the city of Yining (formerly called Kuldja) within the Ili Valley in the northwest Xinjiang Uygur Autonomous Region. Located 700 kilometers (432 mi.) west of the provincial capital, Yining is predominantly a Kazak and Uzbek town. Ethnic unrest between Xinjiang's Muslim population and the Han Chinese creates a tension in this part of the country. \"Chinese appear uneasy here and warn against staying out after dark, when knives are fast and streets unsafe.\u2026 The local Kazaks and Uzbeks can be a rough bunch (regularly drunk in the evenings and occasionally involved in street fights) but very friendly towards foreigners, whom they put in a different category from those in authority.\"",
